import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import {Card, CardMedia, Grid, Paper, } from '@material-ui/core';

import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';



const useStyles = makeStyles({
    container: {
      background: 'teal',
    },
    item: {
        backgroundColor: "yellow",
    },
    card_root: {
        minWidth: 275,
    },
    media: {
        height: 0,
        paddingTop: '56.25%', // 16:9
    },
    card_text: {
        textAlign: 'center',
    },
  });

function PokeDex() {
    const classes = useStyles();
    return (
        <Grid 
        container 
        className={classes.container} 
        xs={12} 
        spacing={0}
        alignItems="center" 
        justify="center"
        >
            <Grid item xs={4} className={classes.item} >
                <CardActions justify="center">
                    <Card className={classes.card_root} >
                        <a href="google.com">
                            <CardContent>
                                <CardMedia
                                    className={classes.media}
                                    image="https://cdn.bulbagarden.net/upload/thumb/7/7e/006Charizard.png/1200px-006Charizard.png"
                                    title="Paella dish"
                                />
                                <Typography variant="h6" component="h2" className={classes.card_text}>
                                test
                                </Typography>
                            </CardContent>
                        </a>
                    </Card>
                </CardActions>
            </Grid>

        </Grid>
    );
}

export default PokeDex;
